import React from 'react';
import ReactDOM from 'react-dom';
import $ from 'jquery';

class useScript extends React.Component {
    componentDidMount() {
        $( "body" ).delegate( ".btn-edit-book", "click", function( event ) {
            alert('alert');
        })
    }

    // ...
}
